import "./App.css";
import React from "react";
import "./index.css";
import { Navigate, Routes, Route } from "react-router-dom";
import IdeaValidator from "./screens/IdeaValidator";

function App() {
  return (
    <div className="App">
      <Routes>
        <Route path="/" element={<IdeaValidator />} />
      </Routes>
    </div>
  );
}

export default App;
